nt-size:14px;text-transform:uppercase;letter-spacing:1px;font-weight:bold;width:33%;padding:10px\\\" bgcolor\\u003d\\\"#b30738\\\"\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/inclusive-excellence-division/\\\" style\\u003d\\\"text-decoration:none;color:#ffffff!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/inclusive-excellence-division/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3S3uBr1vmllXlL4tS0YD3E\\\"\\u003eInclusive Excellence Division\\u003c/a\\u003e\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/tbody\\u003e\\r\\n\\u003c/table\\u003e\\r\\n\\u003ctable border\\u003d\\\"0\\\" cellpadding\\u003d\\\"0\\\" cellspacing\\u003d\\\"0\\\" role\\u003d\\\"presentation\\\" style\\u003d\\\"width:600px;margin-top:0px;color:#000!important\\\" bgcolor\\u003d\\\"#fff\\\"\\u003e\\r\\n\\u003ctbody\\u003e\\r\\n\\u003ctr\\u003e\\r\\n\\u003ctd style\\u003d\\\"font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-size:14px;line-height:1.46667\\\"\\u003e\\r\\n\\u003cspan name\\u003d\\\"d.en.990613\\\"\\u003e\\u003c/span\\u003e\\r\\n\\u003cdiv style\\u003d\\\"padding:0 20px\\\"\\u003e\\r\\n\\u003cdiv style\\u003d\\\"font-family:\\u0026quot;Open Sans\\u0026quot;,Arial,Helvetica,sans-serif;font-size:17px;color:#b30738;font-weight:bold;padding:20px 0 0\\\"\\u003eInclusive Excellence Newsletter - October 2023\\u003c/div\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e \\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e\\u003cspan\\u003eDear SCU Community:\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e\\u003cspan\\u003eJust a few weekends ago, we were welcoming the Class of 2027 to campus, and now, we are entering the third week of the academic quarter. Amid the fast-pace, we are grateful for the level of engagement and community building that we have witnessed and experienced from the Student Involvement Fair to the overflow crowd at the Mass of the Holy Spirit.  We have appreciated the excitement and positive energy of the packed student organization meetings and the meaningful discussions taking place in the classrooms across campus. This is the vibrant campus life and community connections that illustrate why we call ourselves the Bronco Family. We hope to continue to create opportunities for people to connect.  Please check out the University Calendar to see if there is something that piques your interest.\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003cp align\\u003d\\\"left\\\" style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e\\u003cspan\\u003eSpeaking of interests, October will be a busy month full of \\u003ca href\\u003d\\\"https://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3B6tV5mb9G4FkT-g6fEXRs\\\"\\u003eHispanic/Latiné/x Heritage events,\\u003c/a\\u003e Disability Awareness month efforts, Indigenous People’s Day (October 9) as well as the\\u003ca href\\u003d\\\"https://www.scu.edu/turn/\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/turn/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw0oUP3diK6fZzTX0B9cOBxm\\\"\\u003e tUrn events\\u003c/a\\u003e, National Coming Out Day (October 11), the annual \\u003ca href\\u003d\\\"https://www.scu.edu/alumni/events/reunions/\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/alumni/events/reunions/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3Px4H8CHuXkGf0ff3bJC8W\\\"\\u003eGrand Reunion\\u003c/a\\u003e and Migration Week.  We will start off the month of November with events celebrating Dia de los Muertos. We encourage you to take advantage of rich and diverse programming and opportunities that SCU has to offer. These efforts enhance the SCU experience and enrich learning, working and living on our beautiful campus.\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003cp align\\u003d\\\"center\\\" style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e\\u003cstrong\\u003eInclusive Excellence Student Advisory Councils\\u003c/strong\\u003e\\u003c/p\\u003e\\r\\n\\u003cp align\\u003d\\\"left\\\" style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e\\u003cspan\\u003eWe wanted to lift up a gentle reminder that we are still in the process of recruiting for the Inclusive Excellence Student Advisory Councils\\u003cstrong\\u003e \\u003c/strong\\u003efor both undergraduate and graduate students. We will be seeking interested students from all class years who would be interested in getting more involved in planning such events as the Quarterly Diversity Forums and more.  If you are interested, please\\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://forms.gle/99CAwgPKeerttav26__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTcZaA8mM$\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://forms.gle/99CAwgPKeerttav26__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTcZaA8mM$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw16QuKqj_ylfgxb7GQTwape\\\"\\u003e apply\\u003c/a\\u003e by \\u003cstrong\\u003eOctober 6, 2023.\\u003c/strong\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003chr style\\u003d\\\"border-top-width:1px;border-top-color:#ececec;border-top-style:solid\\\"\\u003e\\r\\n\\u003ch3 style\\u003d\\\"font-family:\\u0026#39;Open Sans\\u0026#39;,Arial,Helvetica,sans-serif;font-weight:400;font-size:20px;color:#6d6d6d;text-transform:uppercase;margin:23px 0 12px;padding:20px 0 0\\\" align\\u003d\\\"center\\\"\\u003e\\u003cstrong\\u003eUNIT UPDATES\\u003c/strong\\u003e\\u003c/h3\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\" align\\u003d\\\"left\\\"\\u003e\\u003cstrong\\u003eI. Inclusive Excellence Division\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli\\u003e\\u003cspan\\u003eShá Duncan Smith, Vice President for Inclusive Excellence will be holding \\u003cstrong\\u003eOffice hours \\u003c/strong\\u003eon Tuesdays from 2- 3PM, 2nd Floor in the Walsh Administration Building\\u003cstrong\\u003e. \\u003c/strong\\u003e \\u003ci\\u003ePlease sign up for a 15 minute slot \\u003c/i\\u003eby using the following link: \\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://calendar.app.google/cq8ffHgbfoeRfn916__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCT9G47rkg$\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://calendar.app.google/cq8ffHgbfoeRfn916__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCT9G47rkg$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3q0cKQVAYhD--SDA1what-\\\"\\u003ehttps://calendar.app.\\u003cwbr\\u003egoogle/cq8ffHgbfoeRfn916\\u003c/a\\u003e\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli\\u003e\\u003cspan\\u003e\\u003cspan\\u003eA\\u003cspan\\u003e \\u003c/span\\u003e\\u003c/span\\u003e\\u003cstrong\\u003especial thank you\\u003c/strong\\u003e\\u003cspan\\u003e\\u003cspan\\u003e \\u003c/span\\u003eto the Staff and Faculty Senates for their collaboration with Inclusive Excellence for the Welcome Back Social that was held on September 28th for faculty and staff.  We appreciated the positive energy and the engagement and we are excited about future collaborative opportunities to enhance belonging efforts. \\u003c/span\\u003e\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli\\u003eIf you missed out on the \\u003cstrong\\u003especial \\u0026quot;Los Broncos\\u0026quot; shirts\\u003c/strong\\u003e during this SCU Women\\u0026#39;s Soccer Match on September 24th, Inclusive Excellence will be doing a special re-printing. In order to request your shirt, please complete the following \\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://forms.gle/kqpDi6sV3Azj8YEU9__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTThx2TiA$\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://forms.gle/kqpDi6sV3Azj8YEU9__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTThx2TiA$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw1S3V7K1uREREu5mJw90HHQ\\\"\\u003esurvey\\u003c/a\\u003e.  It will be first-come, first-serve based on the submissions.\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\" align\\u003d\\\"center\\\"\\u003e\\u003cimg src\\u003d\\\"https://ci5.googleusercontent.com/proxy/2q7Tm2KfBclQgi1XrQAPaD5jT73IVej0D62NP7C0Etp40ElKelGQUURLBonhYOZySeRsJmY0xfJ6pxsIiMJvUjYswY2krxkCL-aOUrmvkw-Pwl3cisoZV9wxCpqLkaJ4j_jC97mxzoAv72xkQUZjvCsMqrI\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/IMG_2812-760x444.jpg\\\" alt\\u003d\\\"Los Broncos\\\" width\\u003d\\\"350\\\" height\\u003d\\\"204\\\" style\\u003d\\\"display:block;max-width:100%;height:auto!important\\\"\\u003e\\u003c/p\\u003e\\r\\n\\u003ctable style\\u003d\\\"width:100%;height:91px;margin-top:0px;border-style:double\\\" border\\u003d\\\"1\\\" cellpadding\\u003d\\\"1\\\" bgcolor\\u003d\\\"#f1c40f\\\"\\u003e\\r\\n\\u003cthead\\u003e\\r\\n\\u003ctr style\\u003d\\\"height:91px\\\"\\u003e\\r\\n\\u003ctd style\\u003d\\\"width:99.5077%;height:91px\\\" scope\\u003d\\\"col\\\" align\\u003d\\\"center\\\"\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\" align\\u003d\\\"center\\\"\\u003e\\u003cstrong\\u003eDIA DE LOS MUERTOS\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\" align\\u003d\\\"left\\\"\\u003e\\u003cstrong\\u003eSave the Date\\u003c/strong\\u003e\\u003cspan\\u003e for a special community celebration around \\u003c/span\\u003e\\u003cem\\u003eDia de los Muertos\\u003c/em\\u003e\\u003cspan\\u003e on Saturday, November 4th from 5 - 9pm on the SCU campus featuring arts \\u0026amp; crafts, ofrendas, food and music. The event is being sponsored by SCU, the Consulate General of Mexico and Univision. If your organization/department is interested in participating in creating an ofrenda or in volunteering, please email: \\u003c/span\\u003e\\u003ca href\\u003d\\\"mailto:inclusiveexcellence@scu.edu\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\"\\u003einclusiveexcellence@\\u003cwbr\\u003escu.edu.\\u003c/a\\u003e\\u003cspan\\u003e We will follow-up with more details.\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003c/td\\u003e\\r\\n\\u003c/tr\\u003e\\r\\n\\u003c/thead\\u003e\\r\\n\\u003c/table\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\"\\u003e \\u003c/p\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eII. LEAD Scholars Program\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eIn late September, the LEAD Scholars Program welcomed back our students by hosting a Welcome Back dinner and a DIY Dorm Decor workshop. \\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eLEAD is excited to offer\\u003c/span\\u003e\\u003cstrong\\u003e site-visits to major companies in the Bay Area\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. On Wednesday, October 4, the LEAD Scholars Program will tour KPMG’s Santa Clara office and meet with employees to learn more about careers in accounting. Later, on October 19, LEAD will travel to HP headquarters in Palo Alto, CA and participate in Black Student Day @ HP. \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eThe LEAD Scholars program will provide students with opportunities to visit the San Jose Art Museum during their First Friday event (10/6) and the Kehinde Whiley exhibit at San Francisco’s de Young Museum (10/8). \\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eJoin us for \\u003c/span\\u003e\\u003cstrong\\u003eLEAD’s 20th Anniversary Celebration at SCU’s Grand Reunion\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e on Saturday, October 14 from 5:30-7:00 PM in the Malley Center. Join us for reflections from alumni across our 20-year history, and learn how LEAD continues to provide first-generation college students access to all that SCU has to offer. We\\u0026#39;ll celebrate with community, food, drink and music! Register \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/alumni/events/reunions/\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/alumni/events/reunions/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3Px4H8CHuXkGf0ff3bJC8W\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003ehere\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003eLEAD’s first-year and new transfer students will \\u003cstrong\\u003etalk with Dr. Francisco Jimenez\\u003c/strong\\u003e on Thursday, October 26 after reading his book \\u003ci\\u003eReaching Out\\u003c/i\\u003e about his experience as a first-generation college student at SCU in their LEAD Seminar courses.\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003eUndocumented Student Working Group (USWG)\\u003cstrong\\u003e \\u003c/strong\\u003eand Undocumented Students and Allies Association (USAA) are partnering to host \\u003cstrong\\u003eMigration Week\\u003c/strong\\u003e\\u003cspan\\u003e which will include: \\u003c/span\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cstrong\\u003e\\u003ci\\u003eHorizons beyond DACA: Advocating for the rights of all immigrant youth\\u003c/i\\u003e\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e with\\u003c/span\\u003e\\u003ci\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e \\u003c/span\\u003e\\u003c/i\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eJu Hong, Director of UCLA’s Dream Center, Tuesday, October 17 from 4:00-6:00 PM, Williman Room\\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"2\\\"\\u003e\\r\\n\\u003cstrong\\u003e\\u003ci\\u003eUndocuCon: Building a Brighter Future for Undocumented Students.\\u003c/i\\u003e\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e Sponsored by the Region 4 Bay Area Community Colleges and Santa Clara University, this conference will offer a range of sessions to provide information, advocacy and community for undocumented students, Friday, October 20 from 9:00 AM- 2:00 PM, Benson Center, Register\\u003c/span\\u003e\\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://forms.office.com/pages/responsepage.aspx?id\\u003diuGPAuNTGkqSmD2pznHsk9QGKzNRB65Dmtx2Y2_ST9lURjU0VVUzQ0FaRE9IT1dMMkhEMjIyOE1WTy4u__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTM4xbaf8$\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://forms.office.com/pages/responsepage.aspx?id%3DiuGPAuNTGkqSmD2pznHsk9QGKzNRB65Dmtx2Y2_ST9lURjU0VVUzQ0FaRE9IT1dMMkhEMjIyOE1WTy4u__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTM4xbaf8$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182085000\\u0026amp;usg\\u003dAOvVaw3iIpWzscVbXJsYGTnPIWY-\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e \\u003c/span\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003ehere\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e by 10/13 \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"2\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003ePlease look out for the full schedule soon!\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eIII. Multicultural Center (MCC)\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eThe MCC is located at the Shapell Lounge, which is across from the SCU Bookstore at Benson Memorial Center.\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli\\u003eThe MCC clubs are officially underway with their meetings listed noted below:\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\" align\\u003d\\\"center\\\"\\u003e\\u003cimg src\\u003d\\\"https://ci3.googleusercontent.com/proxy/cEtdtqoLaMQmztOL80Ydgwz9ZTzYhqqLEHys2jLhJuRwBLXNCOqHjUqUMJ9Ni-e4Z86CzHssE0XjbHqvVrthcnxZkdVyJ0jb37S3kG0TtFgFRAfR5NbCdpNHIoZayu0w2eT0rB88VFSM3SfCDXoBB1_f2Q\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/unnamed-760x425.jpg\\\" alt\\u003d\\\"MCC Meeting times\\\" width\\u003d\\\"350\\\" height\\u003d\\\"196\\\" style\\u003d\\\"display:block;max-width:100%;height:auto!important\\\"\\u003e\\u003c/p\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eIV. Office of Accessible Education (OAE)\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli dir\\u003d\\\"auto\\\"\\u003eHappy October from the OAE!!\\u003c/li\\u003e\\r\\n\\u003cli dir\\u003d\\\"auto\\\"\\u003eOctober 12th 5-7pm will be our first ever Pumpkin Painting night!!  This will be a great event for OAE students to come connect and also have some fun. If you are interested, please email the OAE at\\u003cspan\\u003e \\u003c/span\\u003e\\u003ca href\\u003d\\\"mailto:OAE@scu.edu\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\"\\u003eOAE@scu.edu\\u003c/a\\u003e\\u003cspan\\u003e \\u003c/span\\u003eso that we can have enough pumpkins!\\u003c/li\\u003e\\r\\n\\u003cli dir\\u003d\\\"auto\\\"\\u003eWe will be working on having more of these type of events as we grow the OAE. \\u003c/li\\u003e\\r\\n\\u003cli dir\\u003d\\\"auto\\\"\\u003eWe will also be working on events with guest speakers. If you are interested in working with the OAE to create outreach to students, please email our Operations Manager at\\u003cspan\\u003e \\u003c/span\\u003e\\u003ca href\\u003d\\\"mailto:Csmead@scu.edu\\\" rel\\u003d\\\"noopener\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\"\\u003eCsmead@scu.edu\\u003c/a\\u003e \\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eV. Office for Equal Opportunity and Title IX\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e\\u003cstrong\\u003eThe Office of Equal Opportunity and Title IX\\u003c/strong\\u003e is responsible for oversight of reports made to the university when incidents involve harassment and discrimination in all forms including gender and sexual based harassment, discrimination and sexual misconduct. You can file a Request for Support \\u0026amp; Assistance form for yourself or someone you know online. \\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eAs a reminder, if you are a staff or faculty member and learn of an incident alleging this type of concern, you are required by law to report it to the university. \\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eRegardless of your decision to pursue a formal complaint and investigation with the University, you are entitled to and given access to supportive measures and support resources. We are happy to discuss any and all options and possibilities for your individual case and needs. You can also reach out to Director of Equal Opportunity and Title IX, Aaron Zisser directly at \\u003ca href\\u003d\\\"mailto:azisser@scu.edu\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\"\\u003eazisser@scu.edu\\u003c/a\\u003e further consultation and support. You can also stop by our office at 140 Loyola Hall or call 551-3043.\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eVI. Office for Diversity and Inclusion (ODI)\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eThe first \\u003c/span\\u003e\\u003cstrong\\u003eCommunity Conversation\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e of the Fall quarter is scheduled for Tuesday, October 3rd from 12:10pm - 1:30pm. This Community Conversation is focused on\\u003c/span\\u003e\\u003ci\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e Latino/a/e/x Issues in the United States\\u003c/span\\u003e\\u003c/i\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. Please \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://scu.zoom.us/meeting/register/tJwudO2srjgtHNPI4jNPDmtGUHDpL-iE21eR__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTJr8BgQE$\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://scu.zoom.us/meeting/register/tJwudO2srjgtHNPI4jNPDmtGUHDpL-iE21eR__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCTJr8BgQE$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw2dl2TYFRlV4SUx6UipJtSt\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eregister\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e to access the zoom link.\\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eAs part of the \\u003ca href\\u003d\\\"https://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw08q90vn_mI0YgOrkOnuDCk\\\"\\u003eHispanic/Latiné/x Heritage Month\\u003c/a\\u003e events, we encourage you to stop by the Walsh Admin lobby to view a \\u003cstrong\\u003especial exhibit by Pancho Jiménez\\u003c/strong\\u003e, a Senior Lecturer in the Department of Art and Art History. In the work being exhibited, he explored the issue of immigration.\\u003c/span\\u003e\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\" align\\u003d\\\"center\\\"\\u003e\\u003cimg src\\u003d\\\"https://ci3.googleusercontent.com/proxy/bTSCz4Nx5e9ChWOnOSfDdpe5ghqlRMW0iiQuxiGOe0E_pAi7qQP6nSSeeBjS-4sgcj_bH-ALbHTxtCEss-oymIbk8_U00TdYftkgivamHujmw9dl0cGOgylKWemVlMl0SSI_VQQHxbBdfitzOZDslFZvdcTCDx8_\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/migrationpj-760x1013.jpg\\\" alt\\u003d\\\"Migration by Pancho Jiménez\\\" width\\u003d\\\"250\\\" height\\u003d\\\"333\\\" style\\u003d\\\"display:block;max-width:100%;height:auto!important\\\"\\u003e\\u003c/p\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eThe Transfer Student Working Group held a successful \\u003c/span\\u003e\\u003cstrong\\u003eTransfer Student Welcome Social\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e on Tuesday, September 26th. Thanks to all of the transfer students that attended and we look forward to working closely with the different campus partners. \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eA number of \\u003c/span\\u003e\\u003cstrong\\u003eTenure Track positions for the 2024-2025 academic year\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e have been posted. Please share information about these openings with your colleagues and peers at other institutions. To learn more, please visit:  \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/hr/careers/\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/hr/careers/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw17oKvGu1AhfJbBwKztVL0b\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003ehttps://www.scu.edu/hr/\\u003cwbr\\u003ecareers/\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eDates and times for the Fall quarter \\u003c/span\\u003e\\u003cstrong\\u003eSafe Space and UndocuAlly Workshops\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e for Faculty and Staff are now available on the \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/diversity/\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/diversity/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw2bvhHt6ipg1DlnwsBOVJu7\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eODI Website\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. Workshops begin the week of October 9th.\\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eWe are seeking interested members of the SCU community to be involved in the respective \\u003c/span\\u003e\\u003cstrong\\u003eHeritage Month planning committees.\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e The most immediate need will be those interested in the Native/Indigenous Heritage Month (November) and Black History Month committee. If interested, please respond via this \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://forms.gle/SzEzEWyXosNwvZGx8__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCT0HNt4I8$\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://forms.gle/SzEzEWyXosNwvZGx8__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCT0HNt4I8$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw0gf2FkTjYyH9MScYh1zZEC\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eform\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. \\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eSCU will be marking \\u003c/span\\u003e\\u003cstrong\\u003eIndigenous People’s Day on Monday, October 9th\\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. This will be the last year that classes are held on this day, \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/president/messages-from-santa-clara-university/commitment-to-serving-underrepresented-students/\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/president/messages-from-santa-clara-university/commitment-to-serving-underrepresented-students/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw2I1sXwvRWAMaZQM4X212Gr\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eas it becomes a formal academic holiday in 2024\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e. A Teach-in will be taking place from 11:00am - 2:00pm and will be followed by a Town Hall on SCU’s Indigenous Efforts from 4:00pm - 5:00pm. More details will be sent in a separate email.\\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003ch4 style\\u003d\\\"font-family:\\u0026quot;Trade Gothic W01 Bold_2\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\"\\u003e\\u003cstrong\\u003eVII. Office for Multicultural Learning (OML)\\u003c/strong\\u003e\\u003c/h4\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cstrong\\u003e\\u003ci\\u003eWhat is OML and how do I get Involved?  \\u003c/i\\u003e\\u003c/strong\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003eOML is an official office at SCU and not a club. This means that the OML events and programs are open to everyone. We have Student Inclusion Educators (SIEs) who work at the office and put on various programs.\\u003c/li\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003eOML provides educational workshops (such as Racial Justice workshops and Difficult Dialogues), and cultural/heritage celebrations (such as Lunar New Year and Latinx Heritage month celebrations). You can also request DEI-related workshops from us for your student organizations/clubs. You can find out about our events through our social media.\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cstrong\\u003e\\u003ci\\u003eIs the OML related to the MCC?\\u003c/i\\u003e\\u003c/strong\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003eAlthough we both have the word “multicultural” in our name, we are actually not the same. The Office for Multicultural Learning (OML) is an office led by pro-staff and SIEs that puts on programming and events centered around DEI, social justice and intersectionality. We are located at 832 Market Street (a house actress the street from Swig Residence Hall)\\u003c/li\\u003e\\r\\n\\u003cli aria-level\\u003d\\\"1\\\"\\u003eThe Multicultural Center (MCC) is the multicultural programming body and racial/ethnic advocacy voice for students. The MCC is student-run and includes various registered student organizations. The MCC operates out of the Shapell Lounge (in front of Benson, across from the Bronco Bookstore).\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\u003cp style\\u003d\\\"margin-top:0;padding-top:0;font-family:\\u0026quot;Trade Gothic Next W01\\u0026quot;,\\u0026quot;Helvetica Neue\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\" align\\u003d\\\"center\\\"\\u003e\\u003cimg src\\u003d\\\"https://ci3.googleusercontent.com/proxy/pKODGNY5wmvw6H5gngfU9PmkRvuk7swyPy7-71jsm_PnC34ufYnwvOtP-WcVu08ZvUW0XdMt8uGj7Sq7dr_CG1V12cMH591rTcg1pq3Z9pT3FDhI73gxBmFrqZA9jWBFIeuV108aTwx-Lcsx7na_MSeUJA88TpaGBbY6_YlGbxeEbIx3Z7W0qehUUyrRcg\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/Latine%C3%8C%C2%81x-Heritage-Month-760x760.jpg\\\" alt\\u003d\\\"Latinx Heritage Month\\\" width\\u003d\\\"350\\\" height\\u003d\\\"350\\\" style\\u003d\\\"display:block;max-width:100%;height:auto!important\ ity/division-of-inclusive-excellence/Insta-Una-noche-en-Latinoamerica-Instagram-Post-Square-760x760.png\\\" alt\\u003d\\\"Una Noche Program\\\" width\\u003d\\\"350\\\" height\\u003d\\\"350\\\" style\\u003d\\\"display:block;max-width:100%;height:auto!important\\\"\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\r\\n\\u003cul\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cstrong\\u003eFaculty and Staff Survey: \\u003c/strong\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eAny feedback that you provide allows us to develop relevant, timely, and impactful programs. Complete our \\u003c/span\\u003e\\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://docs.google.com/forms/d/e/1FAIpQLSeeQLW76NsKqXeaetKGoVZoCKNkybGr-B4g45sUn2lnuoJI9Q/viewform?usp\\u003dsf_link__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCThSUuvwY$\\\" style\\u003d\\\"text-decoration:underline;color:#b30738!important\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://docs.google.com/forms/d/e/1FAIpQLSeeQLW76NsKqXeaetKGoVZoCKNkybGr-B4g45sUn2lnuoJI9Q/viewform?usp%3Dsf_link__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpOafdrDhtVxKw9tozco9NxNVFEddCThSUuvwY$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182086000\\u0026amp;usg\\u003dAOvVaw2Gv6hGRvud1_geK9Aq2HF0\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003eanonymous, three question survey\\u003c/span\\u003e\\u003c/a\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e to share your thoughts and ideas!\\u003c/span\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e\\u003c/span\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003cli style\\u003d\\\"font-weight:400\\\" aria-level\\u003d\\\"1\\\"\\u003e\\u003cspan style\\u003d\\\"font-weight:400\\\"\\u003e\\u003cstrong\\u003eSeeking All Gender Restrooms?\\u003c n-top:0px;padding-top:0px\\\"\\u003e\\u003cbr\\u003e\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eMembers of the Santa Clara Community,\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003e\\u003ca href\\u003d\\\"https://www.scu.edu/vice-provost-for-student-life/-mental-health-first-aid/\\\" style\\u003d\\\"color:rgb(179,7,56)\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://www.scu.edu/vice-provost-for-student-life/-mental-health-first-aid/\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182068000\\u0026amp;usg\\u003dAOvVaw3QaJivXPelFOWjQG33Acxf\\\"\\u003eMental Health First Aid\\u003c/a\\u003e is a nationally recognized training program that teaches participants how to identify, understand and respond to signs of mental health concerns and substance use. SCU first launched the program in January 2022. To date, over 270 faculty, staff and students have completed the training. \\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eWe have three training opportunities this term. Participants will need to be available for the entirety of the training which will be held in person. In addition, there is approximately 2 to  2 ½  hours of pre-coursework that will need to be completed online prior to your scheduled training. Each session is limited to 30 participants and is open to faculty, staff and students. Training will be offered on:\\u003c/p\\u003e\\u003cul\\u003e\\u003cli\\u003eOctober 26th and 27th,  9am-1pm on both days \\u003c/li\\u003e\\u003cli\\u003eNovember 1, 9am-3pm (Offered by Momentum for Health, but will be on-campus)\\u003c/li\\u003e\\u003cli\\u003eDecember 13th and 14th, 9am-1pm on both days \\u003c/li\\u003e\\u003c/ul\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003e\\u003cstrong\\u003ePlease register by October 15, using this link:\\u003c/strong\\u003e \\u003ca href\\u003d\\\"https://urldefense.com/v3/__https://forms.gle/kKi5JaSR3x3BA55AA__;!!MLMg-p0Z!BJj1zkQg_GWcGpcWe9Kxv2BpJb89-bftzAhQgw06DM5RsBIN6mLE-HSbuBpDmh5rBQjYtXlJ7RPqcLq0MQsdLQ$\\\" style\\u003d\\\"color:rgb(179,7,56)\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://urldefense.com/v3/__https://forms.gle/kKi5JaSR3x3BA55AA__;!!MLMg-p0Z!BJj1zkQg_GWcGpcWe9Kxv2BpJb89-bftzAhQgw06DM5RsBIN6mLE-HSbuBpDmh5rBQjYtXlJ7RPqcLq0MQsdLQ$\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1696387182068000\\u0026amp;usg\\u003dAOvVaw1WyZLu8TqR5bHhqxeXzlRE\\\"\\u003eMental Health First Aid Registration.\\u003c/a\\u003e\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eA huge thank you our trained facilitators who will be offering training this term:\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eMelina Johnson, Education \\u003cbr\\u003eColleen Maeder, Office of Student Life \\u003cbr\\u003eLupe Ponce-Gomez, Campus Safety Services\\u003cbr\\u003eChristelle Sabatier, Biology \\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eIf you have questions, please email \\u003ca href\\u003d\\\"mailto:cowellcenter@scu.edu\\\" style\\u003d\\\"color:rgb(179,7,56)\\\" target\\u003d\\\"_blank\\\"\\u003ecowellcenter@scu.edu\\u003c/a\\u003e. \\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eThank you for supporting our mental health efforts on campus.\\u003c/p\\u003e\\u003cp style\\u003d\\\"margin-top:0px;padding-top:0px\\\"\\u003eHeather Dumas-Dyer \\u003cbr\\u003eInterim Director of Health and Counseling \\u003c/p\\u003e\\u003c/div\\u003e\\u003c/td\\u003e\\u003c/tr\\u003e\\u003c/tbody\\u003e\\u003c/table\\u003e\\u003ctable border\\u003d\\\"0\\\" cellpadding\\u003d\\\"0\\\" cellspacing\\u003d\\\"0\\\" role\\u003d\\\"presentation\\\" style\\u003d\\\"margin-top:0px;min-width:100%;background-color:rgb(78,69,64)\\\"\\u003e\\u003ctbody\\u003 f!important;font-size:14px!important\\\\\\\"\\\\u003e\\\\u003cspan\\\\u003eDear SCU Community:\\\\u003c/span\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003cp style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\"\\\\u003e\\\\u003cspan\\\\u003eJust a few weekends ago, we were welcoming the Class of 2027 to campus, and now, we are entering the third week of the academic quarter. Amid the fast-pace, we are grateful for the level of engagement and community building that we have witnessed and experienced from the Student Involvement Fair to the overflow crowd at the Mass of the Holy Spirit.  We have appreciated the excitement and positive energy of the packed student organization meetings and the meaningful discussions taking place in the classrooms across campus. This is the vibrant campus life and community connections that illustrate why we call ourselves the Bronco Family. We hope to continue to create opportunities for people to connect.  Please check out the University Calendar to see if there is something that piques your interest.\\\\u003c/span\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003cp align\\\\u003d\\\\\\\"left\\\\\\\" style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\"\\\\u003e\\\\u003cspan\\\\u003eSpeaking of interests, October will be a busy month full of \\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\\\\\" rel\\\\u003d\\\\\\\"noopener\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182085000\\\\u0026amp;usg\\\\u003dAOvVaw3B6tV5mb9G4FkT-g6fEXRs\\\\\\\"\\\\u003eHispanic/Latiné/x Heritage events,\\\\u003c/a\\\\u003e Disability Awareness month efforts, Indigenous People\\u2019s Day (October 9) as well as the\\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/turn/\\\\\\\" rel\\\\u003d\\\\\\\"noopener\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/turn/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182085000\\\\u0026amp;usg\\\\u003dAOvVaw0oUP3diK6fZzTX0B9cOBxm\\\\\\\"\\\\u003e tUrn events\\\\u003c/a\\\\u003e, National Coming Out Day (October 11), the annual \\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/alumni/events/reunions/\\\\\\\" rel\\\\u003d\\\\\\\"noopener\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/alumni/events/reunions/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182085000\\\\u0026amp;usg\\\\u003dAOvVaw3Px4H8CHuXkGf0ff3bJC8W\\\\\\\"\\\\u003eGrand Reunion\\\\u003c/a\\\\u003e and Migration Week.  We will start off the month of November with events celebrating Dia de los Muertos. We encourage you to take advantage of rich and diverse programming and opportunities that SCU has to offer. These efforts enhance the SCU experience and enrich learning, working and living on our beautiful campus.\\\\u003c/span\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003cp align\\\\u003d\\\\\\\"center\\\\\\\" style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helve margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\" align\\\\u003d\\\\\\\"center\\\\\\\"\\\\u003e\\\\u003cimg src\\\\u003d\\\\\\\"https://ci5.googleusercontent.com/proxy/2q7Tm2KfBclQgi1XrQAPaD5jT73IVej0D62NP7C0Etp40ElKelGQUURLBonhYOZySeRsJmY0xfJ6pxsIiMJvUjYswY2krxkCL-aOUrmvkw-Pwl3cisoZV9wxCpqLkaJ4j_jC97mxzoAv72xkQUZjvCsMqrI\\\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/IMG_2812-760x444.jpg\\\\\\\" alt\\\\u003d\\\\\\\"Los Broncos\\\\\\\" width\\\\u003d\\\\\\\"350\\\\\\\" height\\\\u003d\\\\\\\"204\\\\\\\" style\\\\u003d\\\\\\\"display:block;max-width:100%;height:auto!important\\\\\\\"\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003ctable style\\\\u003d\\\\\\\"width:100%;height:91px;margin-top:0px;border-style:double\\\\\\\" border\\\\u003d\\\\\\\"1\\\\\\\" cellpadding\\\\u003d\\\\\\\"1\\\\\\\" bgcolor\\\\u003d\\\\\\\"#f1c40f\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cthead\\\\u003e\\\\r\\\\n\\\\u003ctr style\\\\u003d\\\\\\\"height:91px\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003ctd style\\\\u003d\\\\\\\"width:99.5077%;height:91px\\\\\\\" scope\\\\u003d\\\\\\\"col\\\\\\\" align\\\\u003d\\\\\\\"center\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\" align\\\\u003d\\\\\\\"center\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eDIA DE LOS MUERTOS\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cp style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\" align\\\\u003d\\\\\\\"left\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eSave the Date\\\\u003c/strong\\\\u003e\\\\u003cspan\\\\u003e for a special community celebration around \\\\u003c/span\\\\u003e\\\\u003cem\\\\u003eDia de los Muertos\\\\u003c/em\\\\u003e\\\\u003cspan\\\\u003e on Saturday, November 4th from 5 - 9pm on the SCU campus featuring arts \\\\u0026amp; crafts, ofrendas, food and music. The event is being sponsored by SCU, the Consulate General of Mexico and Univision. If your organization/department is interested in participating in creating an ofrenda or in volunteering, please email: \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"mailto:inclusiveexcellence@scu.edu\\\\\\\" rel\\\\u003d\\\\\\\"noopener\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\"\\\\u003einclusiveexcellence@\\\\u003cwbr\\\\u003escu.edu.\\\\u003c/a\\\\u003e\\\\u003cspan\\\\u003e We will follow-up with more details.\\\\u003c/span\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003c/td\\\\u003e\\\\r\\\\n\\\\u003c/tr\\\\u003e\\\\r\\\\n\\\\u003c/thead\\\\u003e\\\\r\\\\n\\\\u003c/table\\\\u003e\\\\r\\\\n\\\\u003cp style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\"\\\\u003e \\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eII. LEAD Scholars Program\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eIn late September, the LEAD Scholars Program welcomed back our students by hosting a Welcome Back dinner and a DIY Dorm Decor workshop. \\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eLEAD is excited to offer\\\\u003c/span\\\\u003e\\\\u003cstrong\\\\u003e site-visits to major companies in the Bay Area\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e. On Wednesday, October 4, the LEAD Scholars Program will tour KPMG\\u2019s Santa Clara office and meet with employees to learn more about careers in accounting. Later, on October 19, LEAD will travel to HP headquarters in Palo Alto, CA and participate in Black Student Day @ HP. \\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eThe LEAD Scholars program will provide students with opportunities to visit the San Jose Art Museum during their First Friday event (10/6) and the Kehinde Whiley exhibit at San Francisco\\u2019s de Young Museum (10/8). \\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eJoin us for \\\\u003c/span\\\\u003e\\\\u003cstrong\\\\u003eLEAD\\u2019s 20th Anniversary Celebration at SCU\\u2019s Grand Reunion\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e on Saturday, October 14 from 5:30-7:00 PM in the Malley Center. Join us for reflections from alumni across our 20-year history, and learn how LEAD continues to provide first-generation college students access to all that SCU has to offer. We\\\\u0026#39;ll celebrate with community, food, drink and music! Register \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/alumni/events/reunions/\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/alumni/events/reunions/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182085000\\\\u0026amp;usg\\\\u003dAOvVaw3Px4H8CHuXkGf0ff3bJC8W\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003ehere\\\\u003c/span\\\\u003e\\\\u003c/a\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e. \\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eLEAD\\u2019s first-year and new transfer students will \\\\u003cstrong\\\\u003etalk with Dr. Francisco Jimenez\\\\u003c/strong\\\\u003e on Thursday, October 26 after reading his book \\\\u003ci\\\\u003eReaching Out\\\\u003c/i\\\\u003e about his experience as a first-generation college student at SCU in their LEAD Seminar courses.\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eUndocumented Student Working Group (USWG)\\\\u003cstrong\\\\u003e \\\\u003c/strong\\\\u003eand Undocumented Students and Allies Association (USAA) are partnering to host \\\\u003cstrong\\\\u003eMigration Week\\\\u003c/strong\\\\u003e\\\\u003cspan\\\\u003e which will include: \\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cstrong\\\\u003e\\\\u003ci\\\\u003eHorizons beyond DACA: Advocating for the rights of all immigrant youth\\\\u003c/i\\\\u003e\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\ \\"noopener\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\"\\\\u003eCsmead@scu.edu\\\\u003c/a\\\\u003e \\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eV. Office for Equal Opportunity and Title IX\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eThe Office of Equal Opportunity and Title IX\\\\u003c/strong\\\\u003e is responsible for oversight of reports made to the university when incidents involve harassment and discrimination in all forms including gender and sexual based harassment, discrimination and sexual misconduct. You can file a Request for Support \\\\u0026amp; Assistance form for yourself or someone you know online. \\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eAs a reminder, if you are a staff or faculty member and learn of an incident alleging this type of concern, you are required by law to report it to the university. \\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eRegardless of your decision to pursue a formal complaint and investigation with the University, you are entitled to and given access to supportive measures and support resources. We are happy to discuss any and all options and possibilities for your individual case and needs. You can also reach out to Director of Equal Opportunity and Title IX, Aaron Zisser directly at \\\\u003ca href\\\\u003d\\\\\\\"mailto:azisser@scu.edu\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\"\\\\u003eazisser@scu.edu\\\\u003c/a\\\\u003e further consultation and support. You can also stop by our office at 140 Loyola Hall or call 551-3043.\\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eVI. Office for Diversity and Inclusion (ODI)\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eThe first \\\\u003c/span\\\\u003e\\\\u003cstrong\\\\u003eCommunity Conversation\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e of the Fall quarter is scheduled for Tuesday, October 3rd from 12:10pm - 1:30pm. This Community Conversation is focused on\\\\u003c/span\\\\u003e\\\\u003ci\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e Latino/a/e/x Issues in the United States\\\\u003c/span\\\\u003e\\\\u003c/i\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e. Please \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"https://urldefense.com/v3/__https://scu.zoom.us/meeting/register/tJwudO2srjgtHNPI4jNPDmtGUHDpL-iE21eR__;!!MLMg-p0Z!EpmaXZ5QlQpABxSwY7tr83z5GOkesrpZhC4gXc7dw7NrEy3jWFb6rLpO eagues and peers at other institutions. To learn more, please visit:  \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/hr/careers/\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/hr/careers/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182086000\\\\u0026amp;usg\\\\u003dAOvVaw17oKvGu1AhfJbBwKztVL0b\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003ehttps://www.scu.edu/hr/\\\\u003cwbr\\\\u003ecareers/\\\\u003c/span\\\\u003e\\\\u003c/a\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e \\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eDates and times for the Fall quarter \\\\u003c/span\\\\u003e\\\\u003cstrong\\\\u003eSafe Space and UndocuAlly Workshops\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e for Faculty and Staff are now available on the \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/diversity/\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/diversity/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182086000\\\\u0026amp;usg\\\\u003dAOvVaw2bvhHt6ipg1DlnwsBOVJu7\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eODI Website\\\\u003c/span\\\\u003e\\\\u003c/a\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e. Workshops begin the week of October 9th.\\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u0 ght:400\\\\\\\"\\\\u003e. This will be the last year that classes are held on this day, \\\\u003c/span\\\\u003e\\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/president/messages-from-santa-clara-university/commitment-to-serving-underrepresented-students/\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/president/messages-from-santa-clara-university/commitment-to-serving-underrepresented-students/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182086000\\\\u0026amp;usg\\\\u003dAOvVaw2I1sXwvRWAMaZQM4X212Gr\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eas it becomes a formal academic holiday in 2024\\\\u003c/span\\\\u003e\\\\u003c/a\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e. A Teach-in will be taking place from 11:00am - 2:00pm and will be followed by a Town Hall on SCU\\u2019s Indigenous Efforts from 4:00pm - 5:00pm. More details will be sent in a separate email.\\\\u003c/span\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eVII. Office for Multicultural Learning (OML)\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cstrong\\\\u003e\\\\u003ci\\\\u003eWhat is OML and how do I get Involved?  \\\\u003c/i\\\\u003e\\\\u003c/strong\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eOML is an official office at SCU and not a club. This means that the OML events and programs are open to everyone. We have Student Inclusion Educators (SIEs) who work at the office and put on various programs.\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eOML provides educational workshops (such as Racial Justice workshops and Difficult Dialogues), and cultural/heritage celebrations (such as Lunar New Year and Latinx Heritage month celebrations). You can also request DEI-related workshops from us for your student organizations/clubs. You can find out about our events through our social media.\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cstrong\\\\u003e\\\\u003ci\\\\u003eIs the OML related to the MCC?\\\\u003c/i\\\\u003e\\\\u003c/strong\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eAlthough we both have the word \\u201cmulticultural\\u201d in our name, we are actually not the same. The Office for Multicultural Learning (OML) is an office led by pro-staff and SIEs that puts on programming and events centered around DEI, social justice and intersectionality. We are located at 832 Market Street (a house actress the street from Swig Residence Hall)\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003eThe Multicultural Center (MCC) is the multicultural programming body and racial/ethnic advocacy voice for students. The MCC is student-run and includes various registered student organizations. The MCC operates out of the Shapell Lounge (in front of Benson, across from the Bronco Bookstore).\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003c/ul\\\\u003e\\\\r\\\\n\\\\u003cp style\\\\u003d\\\\\\\"margin-top:0;padding-top:0;font-family:\\\\u0026quot;Trade Gothic Next W01\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif!important;font-size:14px!important\\\\\\\" align\\\\u003d\\\\\\\"center\\\\\\\"\\\\u003e\\\\u003cimg src\\\\u003d\\\\\\\"https://ci3.googleusercontent.com/proxy/pKODGNY5wmvw6H5gngfU9PmkRvuk7swyPy7-71jsm_PnC34ufYnwvOtP-WcVu08ZvUW0XdMt8uGj7Sq7dr_CG1V12cMH591rTcg1pq3Z9pT3FDhI73gxBmFrqZA9jWBFIeuV108aTwx-Lcsx7na_MSeUJA88TpaGBbY6_YlGbxeEbIx3Z7W0qehUUyrRcg\\\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/Latine%C3%8C%C2%81x-Heritage-Month-760x760.jpg\\\\\\\" alt\\\\u003d\\\\\\\"Latinx Heritage Month\\\\\\\" width\\\\u003d\\\\\\\"350\\\\\\\" height\\\\u003d\\\\\\\"350\\\\\\\" style\\\\u003d\\\\\\\"display:block;max-width:100%;height:auto!important\\\\\\\"\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eThroughout \\\\u003c/span\\\\u003e\\\\u003cstrong\\\\u003eHispanic/Latiné/x Heritage Month,\\\\u003c/strong\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003e SCU will be hosting a series of \\\\u003ca href\\\\u003d\\\\\\\"https://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\\\\\" style\\\\u003d\\\\\\\"text-decoration:underline;color:#b30738!important\\\\\\\" target\\\\u003d\\\\\\\"_blank\\\\\\\" data-saferedirecturl\\\\u003d\\\\\\\"https://www.google.com/url?q\\\\u003dhttps://www.scu.edu/diversity/heritage-month-celebrations/hispaniclatinex/\\\\u0026amp;source\\\\u003dgmail\\\\u0026amp;ust\\\\u003d1696387182086000\\\\u0026amp;usg\\\\u003dAOvVaw08q90vn_mI0YgOrkOnuDCk\\\\\\\"\\\\u003eengaging and educational events\\\\u003c/a\\\\u003e. We invite you to participate and join in the festivities. OML/RRC will continue to amplify, celebrate and honor the incredible impact that Latiné and Hispanic individuals have had on our u8Ygqe513zM5jRDr1NmTkcvIHJu-bmKBNMPIK2_cceXZRPHubK1JY18CFf9k\\\\u003ds0-d-e1-ft#https://www.scu.edu/media/offices/diversity/division-of-inclusive-excellence/All-Gender-Restrooms-760x760.png\\\\\\\" alt\\\\u003d\\\\\\\"All Gender Restrooms\\\\\\\" width\\\\u003d\\\\\\\"350\\\\\\\" height\\\\u003d\\\\\\\"350\\\\\\\" style\\\\u003d\\\\\\\"display:block;max-width:100%;height:auto!important\\\\\\\"\\\\u003e\\\\u003c/span\\\\u003e\\\\u003c/p\\\\u003e\\\\r\\\\n\\\\u003ch4 style\\\\u003d\\\\\\\"font-family:\\\\u0026quot;Trade Gothic W01 Bold_2\\\\u0026quot;,\\\\u0026quot;Helvetica Neue\\\\u0026quot;,Helvetica,Arial,sans-serif;font-weight:400;font-size:20px;color:#690521;margin:12px 0 3px\\\\\\\"\\\\u003e\\\\u003cstrong\\\\u003eVIII. Office of the Ombuds\\\\u003c/strong\\\\u003e\\\\u003c/h4\\\\u003e\\\\r\\\\n\\\\u003cul\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eThe University Ombuds provides \\\\u003cstrong\\\\u003emultipartial, informal and confidential communication\\\\u003c/strong\\\\u003e support services to faculty and staff. The ombuds assists visitors by listening and helping to clarify goals, identify issues and to explore options when addressing communication challenges, including conflict. Visitors can explore interpersonal tools to navigate challenging situations and the ombuds may provide mediation and facilitation services to promote dialogue, dignity, and respect among participants.\\\\u003c/span\\\\u003e\\\\u003c/li\\\\u003e\\\\r\\\\n\\\\u003cli style\\\\u003d\\\\\\\"font-weight:400\\\\\\\" aria-level\\\\u003d\\\\\\\"1\\\\\\\"\\\\u003e\\\\r\\\\n\\\\u003cspan style\\\\u003d\\\\\\\"font-weight:400\\\\\\\"\\\\u003eIf you would like to set a confidential meeting with the ombuds to explore your situation, contact the Office of the Ombuds at \\\\u003ca href\\\\u003d\\\\\\\"mailto:ombuds@scu.edu\\\\\\\" target\\\\u003d\\\\
